impl Solution {
    pub fn maximums_spliced_array(nums1: Vec<i32>, nums2: Vec<i32>) -> i32 {
        let n = nums1.len();
        let mut sum1 = vec![0; n + 1];
        let mut sum2 = vec![0; n + 1];
        for i in 1..=n {
            sum1[i] = sum1[i - 1] + nums1[i - 1];
            sum2[i] = sum2[i - 1] + nums2[i - 1];
        }
        let (less, greater) = if sum1[n - 1] > sum2[n - 1] {
            (&sum2, &sum1)
        } else {
            (&sum1, &sum2)
        };
        let mut sum_diff = 0;
        let mut i = 0;
        let mut j = 1;
        while i < n && j < n {
            while j <= n && greater[j] - greater[i] < less[j] - less[i] {
                sum_diff = sum_diff.max((less[j] - less[i]) - (greater[j] - greater[i]));
                j += 1;
            }
            i = j;
            j = i + 1;
        }
        greater[n] + sum_diff
    }
}